(function (w) {
    var doc = w.document;
    var inputs = doc.querySelectorAll('form .form-control');
    var select = doc.querySelector('[data-select]');
    var prepare = doc.querySelector('[data-prepare]');
    var download = doc.querySelector('[data-load]');
    var banner = doc.querySelector('#checkImage');
    var checkPhone = doc.querySelector('#checkPhone');
    var phoneInput = doc.querySelector('#phone');
    var phoneWrap = doc.querySelector('#phoneWrap');
    var checkWhatApp = doc.querySelector('#checkWhatApp');
    var whatAppInput = doc.querySelector('#whatApp');
    var whatAppWrap = doc.querySelector('#whatAppWrap');
    var checkIcons = doc.querySelector('#checkIcons');
    var checkLogo = doc.querySelector('#checkLogo');
    var tableSignature = doc.querySelector('#signature > tbody');
    var savedNode = null;
    var savedLogo = null;

    var locations    = doc.querySelector('#locations');
    var locationWrap = doc.querySelector('.locationWrap');

    locations.addEventListener('change', updateLocations);

    var logoWrap = doc.querySelector('#logoWrap');
    var bannerWrap = doc.querySelector('#imageWrap');
    var bannerInput = doc.querySelector('#image');
    var companyRadio = doc.querySelectorAll('#company input');
    var logo = doc.querySelector('.logo');

    var  emailLogo = doc.querySelector('.emailLogo');
    var  websiteLogo = doc.querySelector('.websiteLogo');
    var  phoneLogo = doc.querySelector('.phoneLogo');
    var mapsLogo =  doc.querySelector('.mapsLogo'); 
    var  whatsapp = doc.querySelector('.whatsappLogo');
    var youtube = doc.querySelector('.youtube');
    var linkedin = doc.querySelector('.linkedin');
    var jobLogo = doc.querySelector('.jobLogo');

    var jobIcon = '  data:image/png;base64,'
    var mapsIcon = '  data:image/png;base64,' 

    var websiteIcon =' data:image/png;base64,'

    var emailIcon = ' data:image/png;base64,'

    var phoneIcon = ' data:image/png;base64,'

    var whatsappLogo = ' data:image/png;base64,'

    var linkedinLogo = "data:image/png;base64,"

    var youtubeLogo  = " data:image/png;base64,";

    var myriadLogo = "data:image/png;base64,";
    
    var styleName = doc.querySelector('#preparedName');

    logo.src = myriadLogo;
    for (var i = companyRadio.length - 1; i >= 0; i--) {
      companyRadio[i].addEventListener('click', changeCompany);
    }
    function changeCompany(e) {
      switch(e.target.value) {
        case 'Myriad':
          logo.src = myriadLogo;
          styleName.style.color = "rgb(60, 111, 183)";
          break;
      }
    }

    for (var i = inputs.length - 1; i >= 0; i--) {
      inputs[i].addEventListener('keyup', updateSignature);
    }

    checkPhone.addEventListener('click', function () {
      if (!this.checked) {
        phoneInput.disabled = true;
        phoneLogo.classList.add('is-hidden');
        removeHtmlNodes(phoneWrap);
      } else {
        phoneInput.disabled = false;
        phoneLogo.classList.remove('is-hidden');
        addHtmlNodes(phoneWrap, 'XXXXXXXXXX', 'phoneWrap');
      }
    });
    checkWhatApp.addEventListener('click', function () {
      if (!this.checked) {
        whatAppInput.disabled = true;
        whatsapp.classList.add('is-hidden');
        removeHtmlNodes(whatAppWrap);
      } else {
        whatAppInput.disabled = false;
        whatsapp.classList.remove('is-hidden');
        addHtmlNodes(whatAppWrap, whatAppInput.value, 'whatsappWrap');
      }
    });
    function removeHtmlNodes(node) {
      node.innerHTML = '';
    }
    function addHtmlNodes(node, data, className) {
      var br = doc.createElement('br');
      var span = doc.createElement('span');
      span.classList.add(className);
      span.innerHTML = data;
      node.appendChild(span);
      node.appendChild(br);
    }
    
    /*checkLogo.addEventListener('click', function () {
      this.checked ? removeLogo() : addLogo();
    });*/
    function removeLogo() {
      savedLogo = logoWrap.removeChild(logoWrap.lastElementChild);
    }
    function addLogo() {
      logoWrap.appendChild(savedLogo);
    }

    function updateLocations() {
      switch(locations.selectedOptions[0].value) {
        case 'london':
          locationWrap.innerHTML = "London";
          break;
        case 'paris':
          locationWrap.innerHTML = "18 rue de Calais, 75009 Paris, France";
          break;
        case 'spain':
          locationWrap.innerHTML = "Spain";
          break;
        case 'abidjan':
          locationWrap.innerHTML = "Abidjan";
          break;
        case 'dakar':
          locationWrap.innerHTML = "Immeuble Sen Assurance Vie - VDN, Mermoz, Dakar, Sngal";
          break;
      }
    }

    function updateSignature(e) {
      var id = e.target.id;
      var value = e.target.value;
      var element = doc.querySelector('.' + id);
      // Will add later 
      // var checkBanner = banner.checked;
      console.log(id);
      if (id === 'email') {
        element.href = 'mailto:' + value;
        element.innerHTML = value;
      } else if (id === 'facebook') {
        element.href = value;
      } else if (id === 'twitter') {
        element.href = value;
      } else if (id === 'linkedin') {
        element.href = value;
      } else if (id === 'image') {
        if (checkBanner) {
          createBanner(value);
        }
      } else if (id === 'phone') {
        element =  doc.querySelector('.phoneWrap');
        element.innerHTML = value;
      } else if (id === 'whatApp') {
        element =  doc.querySelector('.whatsappWrap');
        element.innerHTML = value;
      } else {
        element.innerHTML = value;
      }
      
      download.classList.add('is-hidden');
    }

    select.addEventListener('click', selectGmail);

    function selectGmail(event) {
      var id = event.target.dataset.signature;
      var element = doc.querySelector('#' + id);
      selectText(element);
    }

    // from SO: http://stackoverflow.com/a/987376/1592915
    function selectText(element) {
      if (doc.body.createTextRange) {
        range = doc.body.createTextRange();
        range.moveToElementText(element);
        range.select();
      } else if (w.getSelection) {
        selection = w.getSelection();
        range = doc.createRange();
        range.selectNodeContents(element);
        selection.removeAllRanges();
        selection.addRange(range);
        document.execCommand('copy');
      }
    }

    function ready() {
      updateLocations()

      linkedin.src = linkedinLogo;
      youtube.src = youtubeLogo;
      whatsapp.src = whatsappLogo;
      websiteLogo.src = websiteIcon;
      emailLogo.src = emailIcon;
      phoneLogo.src = phoneIcon;    
      mapsLogo.src  = mapsIcon;   
      jobLogo.src  = jobIcon;   

      if (!checkPhone.checked) {
        phoneInput.disabled = true;
        phoneLogo.classList.add('is-hidden');
        removeHtmlNodes(phoneWrap);
      } else {
        phoneInput.disabled = false;
        phoneLogo.classList.remove('is-hidden');
        addHtmlNodes(phoneWrap, phoneInput.value, 'phoneWrap');
      }

      if (!checkWhatApp.checked) {
        whatAppInput.disabled = true;
        whatsapp.classList.add('is-hidden');
        removeHtmlNodes(phoneWrap);
      } else {
        whatAppInput.disabled = false;
        whatsapp.classList.remove('is-hidden');
        addHtmlNodes(whatAppWrap, whatAppInput.value, 'whatsappWrap');
      }


      for (var i = inputs.length - 1; i >= 0; i--) {

        var id = inputs[i].id;
        var value = inputs[i].value;
        var element = doc.querySelector('.' + id);


        if (id === 'email') {
          element.href = 'mailto:' + value;
          element.innerHTML = value;
        } else if (id === 'facebook') {
          element.href = value;
        } else if (id === 'twitter') {
          element.href = value;
        } else if (id === 'linkedin') {
          element.href = value;
        } else if (id === 'name') {
          element.innerHTML = value;
        }  else if (id === 'designation') {
          element.innerHTML = value;
        }
      }
      
      
    }
  
    document.addEventListener("DOMContentLoaded", ready);

  })(window);